function addRoute(provider, url, controller, templateUrl) {
    provider.when(url, {controller: controller, templateUrl: templateUrl});
}


var _outstanding_requests = 0;

function toggle_spinner(requests_diff) {
    _outstanding_requests += requests_diff;
    if (_outstanding_requests <= 0) {
        setTimeout(function () {
            _outstanding_requests <= 0 && $("#spinner").hide();
        }, 1500);
    }
    else {
        setTimeout(function () {
            _outstanding_requests > 0 && $("#spinner").show();
        }, 1500);
    }
}
function updateSpinnerOnRequest() {
    toggle_spinner(1);
}
function updateSpinnerOnResponse() {
    toggle_spinner(-1);
}

httpInterceptor = {
    'request': function (config) {
        updateSpinnerOnRequest();
        return config;
    },
    'requestError': function (rejection) {
        updateSpinnerOnRequest();
        return $q.reject(rejection);
    },
    'response': function (response) {
        updateSpinnerOnResponse();
        return response;
    },
    'responseError': function (rejection) {
        updateSpinnerOnResponse();
        return $q.reject(rejection);
    }
};

callFunctionSpecifiedOnElement = function () {
    'use strict';
    return {
        restrict: "A",
        link: function (scope, element, attrs) {
            var onChangeFunc = element.scope()[attrs.customOnChange];
            element.bind('change', onChangeFunc);
        }
    };
};

searchFocus = ['$timeout', function ($timeout) {

    function link(scope, element) {
        scope.$watch('searchShown', function (value) {
            var focusIfTrue = function () {
                value && element[0].focus();
            };
            $timeout(focusIfTrue, 0, false);
        });
    }

    return {
        link: link
    };
}];

loginFocus = ['$timeout', 'StorageService', function ($timeout, StorageService) {

    function link(scope, element) {
        if (!StorageService.loggedIn()) {
            element[0].focus();
        }
    }

    return {
        link: link
    };
}];

var categoriesValidator = function () {
    var validCategoryValueSets = [["middag", "smårett"]];

    var validate = function (viewValue) {
        var allValid = true;
        validCategoryValueSets.forEach(function (categoryValues) {
            allValid = allValid && containsAtLeastOne(viewValue, categoryValues);
        });
        return allValid;
    };

    var containsAtLeastOne = function (viewValue, validValues) {
        var match = false;
        validValues.forEach(function (validValue) {
            if (new RegExp(validValue).test(" " + viewValue + " "))
                match = true;
        });
        return match;
    };

    return {
        // restrict to an attribute type.
        restrict: 'A',

        // element must have ng-model attribute.
        require: 'ngModel',

        // scope = the parent scope
        // elem = the element the directive is on
        // attr = a dictionary of attributes on the element
        // ctrl = the controller for ngModel.
        link: function (scope, elem, attr, ctrl) {

            // add a parser that will process each time the value is
            // parsed into the model when the user updates it.
            ctrl.$parsers.unshift(function (value) {
                var valid = validate(value);
                ctrl.$setValidity('categories', valid);

                return valid ? value : undefined;
            });

            // add a formatter that will process each time the value
            // is updated on the DOM element.
            ctrl.$formatters.unshift(function (value) {
                ctrl.$setValidity('categories', validate(value));
                // return the value or nothing will be written to the DOM.
                return value;
            });
        }
    };
};

findRecipeById = function (recipes, id) {
    var result = null;
    recipes.forEach(function (it) {
        if (it.$id == id) result = it;
    });
    return result;
};

var TRACE = { ordinal: 0, text: "TRACE" };
var DEBUG = { ordinal: 1, text: "DEBUG" };
var WARN =  { ordinal: 2, text: "WARN"  };
var LOG_LEVEL = TRACE;

(function logLevels() {
}(TRACE, DEBUG, WARN));

traceMsg = function (message) {
    logMsg(message, TRACE);
};

debugMsg = function (message) {
    logMsg(message, DEBUG);
};

logMsg = function (message, logLevel) {
    if (LOG_LEVEL.ordinal <= logLevel.ordinal) {
        console.log(logLevel.text + ": " + message);
    }
};

var utils = utils || {};
utils.firstEntryInMap = function(map) {
    var id = Object.keys(map)[0];
    var object = map[id];
    object.$id = id;
    return object;
};
utils.containsAllTags = function(entity, tags) {
    var result = true;
    tags.forEach(function(tag) {
       if ( ! entity["tag_" + tag] ) result = false;
    });
    return result;
};

function supports_html5_storage() {
    try {
        return 'localStorage' in window && window['localStorage'] !== null;
    } catch (e) {
        return false;
    }
}

var localCache = {

    findImage : function(imageId) { if(1==1) return null; //FIXME
        var imageData = window.localStorage["kokogvin.image." + imageId + ".imageData"];
        if (imageData) {
            return {
                $id: imageId,
                imageData: imageData };
        }
        return null;
    },

    storeImage : function(image) { if (1==1) return; //FIXME
        var success = false;
        while (!success) {
            try {
                var key = "kokogvin.image." + image.$id + ".imageData";
                var value = window.localStorage[key];
                var newValue = image.imageData;
                if (!value) {
                    var storageList = window.localStorage["kokogvin.storageList"];
                    window.localStorage["kokogvin.storageList"] = storageList ? (storageList + "," + key) : key;
                }
                window.localStorage[key] = newValue;
                success = true;
            }
            catch(err) { // TODO: I only assume there's no space left...
                var storageList = window.localStorage["kokogvin.storageList"];
                var firstComma = storageList.indexOf(",");
                var keyToRemove = firstComma >= 0 ? storageList.substring(0, firstComma) : storageList;
                if ( !keyToRemove ) {
                    break;
                }
                delete window.localStorage[keyToRemove];
                window.localStorage["kokogvin.storageList"] = storageList.substring(firstComma + 1);
            }
        }
    },

    removeImage : function(imageId) {
        var key = "kokogvin.image." + imageId + ".imageData";
        delete window.localStorage[key];
        var storageList = window.localStorage["kokogvin.storageList"];
        var newStorageList;
        newStorageList = storageList.replace(new RegExp(key), "").replace(new RegExp(",$"), "");
        window.localStorage["kokogvin.storageList"] = newStorageList;
    },

    clearAll : function() {
        Object.keys(window.localStorage).forEach( function (key) {
            if (/kokogvin/.test(key)) delete window.localStorage[key];
        });
    }
};

utils.clearLocalStorage = function() { localCache.clearAll; }
